r($,"aRk","uJ",()=>A.a([A.mb("Request","Request simplifies your food and grocery shopping with an extensive selection of restaurants and stores. Whether you're craving a gourmet meal, a quick snack, or essential groceries, Request delivers it all to your doorstep. Enjoy easy ordering, personalized recommendations, exclusive deals, and secure payments. Our intuitive interface and real-time tracking ensure a seamless experience, while our dedicated support team is always ready to help. Download Request today and experience the convenience of having your favorite food and essentials delivered right to you.","https://play.google.com/store/apps/details?id=com.Request.request",!1),A.mb("MovieMate","MovieMate is a user-friendly mobile application developed using Flutter and designed with Clean Architecture principles for optimal maintainability and scalability. Experience a sleek and intuitive interface that adapts seamlessly to various screen sizes. Explore a vast collection of movies, including the latest releases, classics, and trending titles. Enjoy detailed movie information, trailers, and user reviews. Advanced search and filtering options help you find your next favorite movie effortlessly. Real-time updates keep you informed about new additions and upcoming releases, enhancing your cinematic journey with a modern and organized touch.","https://github.com/MahmuodMurad/MovieAppUsingCleanArchitectures",!0),A.mb("Bookly","Bookly is a user-friendly mobile application developed using Flutter and designed with MVVM (Model-View-ViewModel) architecture, leveraging Cubit for efficient state management. Enjoy a sleek and intuitive interface that adapts seamlessly to various screen sizes. Discover an extensive library of books, from bestsellers to hidden gems across diverse genres. Access detailed book descriptions, author information, and user reviews. Advanced search and filtering options make it easy to find your next read. Real-time updates keep you informed about new releases and popular titles, enriching your reading experience with a modern, well-structured, and responsive approach.","https://github.com/MahmuodMurad/FreeBooksApp",!0),A.mb("News App","Newsly is a user-friendly mobile application developed using Flutter and designed with MVVM (Model-View-ViewModel) architecture, leveraging Cubit for efficient state management and Dio for robust network handling. Enjoy a sleek and intuitive interface that adapts seamlessly to various screen sizes. Stay updated with the latest news from around the world, including breaking news, top stories, and in-depth articles across various categories. Access detailed news articles, author information, and related stories. Advanced search and filtering options make it easy to find the news that matters to you. Real-time updates ensure you never miss an important story, enriching your news consumption experience with a modern, well-structured, and responsive approach.","https://github.com/MahmuodMurad/NewsApp",!0),A.mb("Meals App","This repository contains a Flutter implementation of a Food Recipe app with a captivating introduction section and impressive animations. It also features a signup and signin page with animations, elegantly presented on a bottom sheet.","https://github.com/MahmuodMurad/MealApp",!0),A.mb("ToDo App","Welcome to the Beautiful Task Scheduler App repository! This Flutter-based task management application combines elegant design with a robust backend, ensuring a seamless and organized task management experience. From stunning UI to real-time synchronization, this app has you covered.","https://github.com/MahmuodMurad/ToDoApp",!0),A.mb("Flutter Chat Application with Firebase","Welcome to our innovative Flutter chat application! This feature-rich messaging platform allows users to connect and communicate seamlessly through text and images. The app is built using Flutter for the frontend and integrates with Firebase for backend services, including authentication, real-time database, and storage.","https://github.com/MahmuodMurad/Chat_App",!0),A.mb("Shop with Firebase","ShopEasy is a user-friendly mobile application designed to provide a seamless shopping experience, built with Flutter and powered by Firebase for real-time data management and authentication. Featuring a modern and intuitive design that adapts beautifully to various screen sizes, ShopEasy offers users a smooth and engaging shopping journey. Browse a diverse range of products, manage your shopping cart, and securely complete transactions with ease. Real-time updates ensure that you always have access to the latest product information and promotions, while Firebase\u2019s robust backend services support efficient data handling and user authentication. ShopEasy combines sleek aesthetics with powerful functionality for a top-notch shopping experience!","https://github.com/MahmuodMurad/ShopAppFireBase",!0),A.mb("GymManagementSystem","Gym Management System is a comprehensive and intuitive application designed to streamline gym operations. Built with Python, this app offers a robust solution for managing memberships, tracking workouts, and scheduling classes. Featuring a user-friendly interface, it allows gym owners and staff to easily manage member profiles, monitor attendance, and generate detailed reports. The system's clean and modern design ensures a seamless experience across various devices, while powerful backend functionalities ensure efficient management of gym activities. Real-time updates and automated processes make managing a gym simpler and more efficient than ever!","https://github.com/MahmuodMurad/PyhtonProject_GymManagementSystem",!0)],A.Z("t<Ju>")))
